import React, { Component } from "react";
import './Project.css';

class Project extends Component {
	render() {

    return (
      <div className="Project">
          <div className="img-header"/>

          <div className="para">
            <h1>{this.props.name}</h1>
            <p>{this.props.body}</p>
          </div>
            <div className="img-header"/>
      </div>
    );
  }
	}

export default Project;
